import React, { useState, useEffect } from 'react';
import {
  ActivityIndicator,
  Alert,
  PermissionsAndroid,
  Platform,
  TouchableOpacity
} from 'react-native';

import LinearGradient from 'react-native-linear-gradient';
import { BluetoothEscposPrinter, BluetoothManager } from 'tp-react-native-bluetooth-printer';

import { AppButton, AppScreen, Block, Text } from '@/components';
import { COLORS } from '@/theme';
import { setConnectedPrinter } from '@/store/reducers/settings';
import { settingsRedux } from '@/store';
import { useAppDispatch, useAppSelector } from '@/hooks';

const ConnectPrinter = () => {
  const [paired, setPaired] = useState([]);
  const [loading, setLoading] = useState(false);
  const [boundAddress, setBoundAddress] = useState([]);
  const [foundDs, setFoundDs] = useState([]);

  const connectedPrinter = useAppSelector(state => state.settings.connectedPrinter);
  const dispatch = useAppDispatch();
  useEffect(() => {
    setBoundAddress(connectedPrinter || '');
    console.log('%cindex.tsx line:30 enabled', 'color: #007acc;', BluetoothManager.getConnectedDevice);


  }, []);
  const navigationOptions = {
    headerTitle: () => (
      <Block row center>
        <Text ml-10 fs-16 sectionTitleDark bold>
          Cihaz Eşleştirme
        </Text>
      </Block>
    ),
    headerTransparent: false,
    headerStyle: {
      backgroundColor: COLORS.white,
      shadowColor: 'transparent',
      elevation: 0
    },
    animationEnabled: true
  };

  const requestBluetoothPermission = async () => {
    try {
      if (Platform.OS === 'android') {
        const granted = await PermissionsAndroid.requestMultiple(
          [
            PermissionsAndroid.PERMISSIONS.BLUETOOTH_SCAN,
            PermissionsAndroid.PERMISSIONS.BLUETOOTH_CONNECT
          ],
          {
            title: 'Bluetooth Scan Permission',
            message: 'Your app needs this permission to scan for Bluetooth devices.'
          }
        );
      }
      if (granted === PermissionsAndroid.RESULTS.GRANTED) {
        console.log('Bluetooth scan permission granted');
      } else {
        console.log('Bluetooth scan permission denied');
      }
    } catch (err) {
      console.warn(err);
    }
  };


  const scanDevices = async () => {
    setLoading(true);
    console.log('%cBillPrintExample.js line:73 scan', 'color: #007acc;', 'scan');
    try {
      const scannedDevices = await BluetoothManager.scanDevices();
      setPaired(JSON.parse(scannedDevices.paired));
      setFoundDs(JSON.parse(scannedDevices.found));
      setLoading(false);
    } catch (error) {
      console.log('%capp/screens/ConnectPrinter/index.tsx:84 error', 'color: #007acc;', error);
      setLoading(false);
      Alert.alert('error' + JSON.stringify(error));
    }
  };

  useEffect(() => {
    const fetchData = async () => {
      await requestBluetoothPermission();

      BluetoothManager.isBluetoothEnabled().then(enabled => {
        BluetoothManager.enableBluetooth().then(r => {
          const pairedDevices = [];
          if (r && r.length > 0) {
            for (let i = 0; i < r.length; i++) {
              try {
                pairedDevices.push(JSON.parse(r[i])); // NEED TO PARSE THE DEVICE INFORMATION
              } catch (e) {
                //ignore
              }
            }
          }   
          setPaired(pairedDevices);

          console.log(JSON.stringify(pairedDevices));
        },
          err => {
            Alert.alert(err);
          }
        );
      },
        err => {
          Alert.alert(err);
        }
      );
    };

    fetchData();
  }, []);

  const printText = async () => {
try{
      await BluetoothEscposPrinter.printerAlign(
        BluetoothEscposPrinter.ALIGN.CENTER,
      );
      await BluetoothEscposPrinter.printPic(
        '',
        {
          width: 384,
          left: 0,
        },
      );
      await BluetoothEscposPrinter.setBlob(0);

      await BluetoothEscposPrinter.printText(
        'KIZLAR PINARI MAH. TORAMANLAR SOK. TOPRAK 4 APT, NO:12 B, Alanya/Antalya\n\r',
        {},
      );
      await BluetoothEscposPrinter.setBlob(0);
      await BluetoothEscposPrinter.printText('0536 574 49 10.\n\r', {
        encoding: 'GBK',
        codepage: 0,
        widthtimes: 0,
        heigthtimes: 0,
        fonttype: 1,
      });

      await BluetoothEscposPrinter.setBlob(0);
      await BluetoothEscposPrinter.printText('0242 512 49 10.\n\r', {
        encoding: 'GBK',
        codepage: 0,
        widthtimes: 0,
        heigthtimes: 0,
        fonttype: 1,
      }); await BluetoothEscposPrinter.printText(
        '\n\r',
        {
          encoding: 'windows-1254',
          codepage: 25,
          widthtimes: 0,
          heigthtimes: 0,
          fonttype: 1,
        },
      );

      await BluetoothEscposPrinter.setBlob(20);
      await BluetoothEscposPrinter.printText('RENTAL AGREEMENT\n\r', {
        encoding: 'GBK',
        codepage: 0,
        widthtimes: 1.3,
        heigthtimes: 1.3,
        fonttype: 1,
      }); await BluetoothEscposPrinter.printText(
        '\n\r',
        {
          encoding: 'windows-1254',
          codepage: 25,
          widthtimes: 0,
          heigthtimes: 0,
          fonttype: 1,
        },
      );

      await BluetoothEscposPrinter.setBlob(20);

      await BluetoothEscposPrinter.printerAlign(
        BluetoothEscposPrinter.ALIGN.LEFT,
      );

      await BluetoothEscposPrinter.printText('Customer Informations\n\r', {
        encoding: 'GBK',
        codepage: 0,
        widthtimes: 1.1,
        heigthtimes: 0,
        fonttype: 1,
      }); await BluetoothEscposPrinter.printText(
        '\n\r',
        {
          encoding: 'windows-1254',
          codepage: 25,
          widthtimes: 0,
          heigthtimes: 0,
          fonttype: 1,
        },
      );

      await BluetoothEscposPrinter.printText('Renter:\n\r', {

        encoding: 'windows-1254'
      });
      await BluetoothEscposPrinter.printText(
        'Home Address: \n\r',
        {},
      );

      await BluetoothEscposPrinter.printText(
        'Hotel: \n\r',
        {},
      );
      await BluetoothEscposPrinter.setBlob(20);
      await BluetoothEscposPrinter.printText('Phone: \n\r', {});
      await BluetoothEscposPrinter.printText('License No: \n\r', {});
      await BluetoothEscposPrinter.printText(
        'Issued By & Date:' +
        '\n\r',
        {},
      );

      await BluetoothEscposPrinter.printText('Place Of Birth: \n\r', {});
      await BluetoothEscposPrinter.printText(
        'Date of Birth: ' + '\n\r',
        {},
      );
      await BluetoothEscposPrinter.printText('Passport No: \n\r', {});
      await BluetoothEscposPrinter.printText(
        'Issued By & Date:' +
        '\n\r',
        {},
      );
      await BluetoothEscposPrinter.printText(
        '--------------------------------\n\r',
        {},
      );

      await BluetoothEscposPrinter.printText('Car Informations\n\r', {
        encoding: 'GBK',
        codepage: 0,
        widthtimes: 0,
        heigthtimes: 0,
        fonttype: 1,
      });
      await BluetoothEscposPrinter.printText('Plate No: \n\r', {});

      await BluetoothEscposPrinter.printerAlign(
        BluetoothEscposPrinter.ALIGN.CENTER,
      );

      await BluetoothEscposPrinter.printText('Signature\n\r', {});
      await BluetoothEscposPrinter.printText(
        '--------------------------------\n\r',
        {},
      );
      await BluetoothEscposPrinter.printText(
        '\n\r',
        {
          encoding: 'windows-1254',
          codepage: 25,
          widthtimes: 0,
          heigthtimes: 0,
          fonttype: 1,
        },
      );

      await BluetoothEscposPrinter.printText(
        '\n\r',
        {
          encoding: 'windows-1254',
          codepage: 25,
          widthtimes: 0,
          heigthtimes: 0,
          fonttype: 1,
        },
      ); await BluetoothEscposPrinter.printText(
        '--------------------------------\n\r',
        {},
      );

      await BluetoothEscposPrinter.setBlob(20);
      await BluetoothEscposPrinter.printerAlign(
        BluetoothEscposPrinter.ALIGN.LEFT,
      );

      await BluetoothEscposPrinter.printPic(
        '',
        {
          width: 600,
          left: 0,
        },
      );
    } catch (error) {
      console.error('Error printing bill:', error);
      Alert.alert('Error printing bill:', error);
    }
    };


  return (
    <>
      <AppScreen scroll safe navigationOptions={navigationOptions} barStyle={
        // check platform
        Platform.OS === 'android' ? 'dark-content' : 'light-content'
      }>
        <Block style={{ borderRadius: 10 }} middle center>
          <LinearGradient colors={['#0193D7', '#00B3E6']} useAngle={true} angle={45} style={{ width: '100%', borderRadius: 10 }}>
            <AppButton
              h-50
              onPress={() => {
                scanDevices();
              }}
              mt-0
              type={'transparent'}
              title={'Taramayı Başlat'}
              loading={loading}
            />
          </LinearGradient>
        </Block>
        {!loading ?
          <Block>
            {foundDs
              ?.filter((rowData, index) => rowData?.name != '')
              ?.map((rowData, index) => {
                return (
                  <Block
                    pressable
                    style={
                      boundAddress === rowData.address ? {
                        backgroundColor: '#e3ffe3',
                        marginTop: 15,
                        padding: 15,
                        borderRadius: 10,
                        borderWidth: 1,
                        borderColor: 'lightgreen',
                      } : {
                        backgroundColor: '#FAFAFA',
                        marginTop: 15,
                        padding: 15,
                        borderRadius: 10,
                        borderWidth: 1,
                        borderColor: '#E0E0E0',
                      }
                    }
                    onPress={() => {
                      console.log('%capp/screens/ConnectPrinter/index.tsx:170 rowData.address', 'color: #007acc;', rowData.address);
                      BluetoothManager.connect(rowData.address).then(
                        s => {
                          setLoading(false);
                          setBoundAddress(rowData.address);
                          dispatch(settingsRedux.setConnectedPrinter(rowData));
                          Alert.alert('Connected');
                        },
                        e => {
                          setLoading(false);
                          Alert.alert(e);
                        },
                      );
                    }}>
                    <Text>{rowData.name}</Text>
                    <Text>{rowData.address}</Text>
                  </Block>
                );
              })}
            {/* paired devices */}

            {paired.map((rowData, index) => {
              return (
                <TouchableOpacity>

                  <Block
                    pressable
                    style={{
                      backgroundColor: '#FAFAFA',
                      marginTop: 15,
                      padding: 15,
                      borderRadius: 10,
                      borderWidth: 1,
                      borderColor: '#E0E0E0',
                    }}
                    onPress={() => {
                      console.log(rowData.address);
                      BluetoothManager.connect(rowData.address).then(
                        s => {
                          setLoading(false);
                          setBoundAddress(rowData.address);
                          dispatch(settingsRedux.setConnectedPrinter(rowData));
                        },
                        e => {
                          setLoading(false);
                          Alert.alert(e);
                        },
                      );
                    }}
                    key={index}>
                    <Text>{rowData.name}</Text>
                    <Text>{rowData.address}</Text>

                    {boundAddress === rowData.address ? <Text style={{ backgroundColor: 'lightgreen' }}>Bağlantı kuruldu.</Text> : null}
                  </Block>
                </TouchableOpacity>
              );
            })}
          </Block> : <Block mt-5>
            <Text>Cihazlar taranıyor...</Text>
          </Block>}

        
      </AppScreen>
    </>
  );
};

export default ConnectPrinter;


